import React, { useEffect, useState } from "react";
import {
  useCreateAirportMutation,
  useUpdateAirportMutation,
} from "../../redux/api/airportApi";
import toast from "react-hot-toast";
import { airports, countries } from "airports-json";

const AirportForm = ({ editingAirport, setShowForm, refetch }) => {
  const [form, setForm] = useState({
    id: "",
    ident: "",
    type: "",
    name: "",
    latitude_deg: "",
    longitude_deg: "",
    elevation_ft: "",
    continent: "",
    iso_country: "",
    iso_region: "",
    municipality: "",
    scheduled_service: "",
    gps_code: "",
    iata_code: "",
    local_code: "",
    home_link: "",
    keywords: "",
    status: "active",
  });

  const [search, setSearch] = useState("");
  const [suggestions, setSuggestions] = useState([]);

  const [createAirport] = useCreateAirportMutation();
  const [updateAirport] = useUpdateAirportMutation();

  // Prefill on Edit
  useEffect(() => {
    if (editingAirport) {
      setForm({
        ...editingAirport,
        elevation_ft: editingAirport.elevation_ft || "",
        keywords: editingAirport.keywords || "",
        home_link: editingAirport.home_link || "",
      });
      setSearch(
        `${editingAirport.name} (${
          editingAirport.iata_code || editingAirport.ident
        })`
      );
    }
  }, [editingAirport]);

  // Search Filter from airports-json
  useEffect(() => {
    if (search.length > 1) {
      const filtered = airports.filter(
        (a) =>
          a.name.toLowerCase().includes(search.toLowerCase()) ||
          a.municipality?.toLowerCase().includes(search.toLowerCase()) ||
          a.iata_code?.toLowerCase().includes(search.toLowerCase())
      );
      setSuggestions(filtered.slice(0, 10));
    } else {
      setSuggestions([]);
    }
  }, [search]);

  // Autofill from selected airport
  const handleSelectAirport = (airport) => {
    setForm({
      id: airport.id,
      ident: airport.ident,
      type: airport.type,
      name: airport.name,
      latitude_deg: Number(airport.latitude_deg),
      longitude_deg: Number(airport.longitude_deg),
      elevation_ft: airport.elevation_ft
        ? Number(airport.elevation_ft)
        : undefined,
      continent: airport.continent,
      iso_country: airport.iso_country,
      iso_region: airport.iso_region,
      municipality: airport.municipality,
      scheduled_service: airport.scheduled_service,
      gps_code: airport.gps_code,
      iata_code: airport.iata_code,
      local_code: airport.local_code,
      home_link: airport.home_link,
      keywords: airport.keywords,
      status: "active",
    });

    setSearch(`${airport.name} (${airport.iata_code || airport.ident})`);
    setSuggestions([]);
  };

  // Handle Submit
  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!form.name || !form.iata_code) {
      toast.error("Airport name and IATA code are required");
      return;
    }

    try {
      if (editingAirport) {
        await updateAirport({ id: editingAirport._id, body: form }).unwrap();
        toast.success("Airport updated successfully");
      } else {
        await createAirport(form).unwrap();
        toast.success("Airport added successfully");
      }
      setShowForm(false);
      refetch();
    } catch (err) {
      toast.error("Failed to save airport");
      console.error(err);
    }
  };

  return (
    <form
      className="border p-3 mb-3 bg-light"
      onSubmit={handleSubmit}
      encType="multipart/form-data"
    >
      <div className="row g-3">
        {/* Search Airport */}
        <div className="col-md-6 position-relative">
          <input
            type="text"
            className="form-control"
            placeholder="Search Airport..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
          />

          {suggestions.length > 0 && (
            <ul
              className="list-group position-absolute w-100"
              style={{ zIndex: 1000 }}
            >
              {suggestions.map((airport) => (
                <li
                  key={airport.id}
                  className="list-group-item list-group-item-action"
                  onClick={() => handleSelectAirport(airport)}
                  style={{ cursor: "pointer" }}
                >
                  {airport.name} ({airport.iata_code || airport.ident}) â€“{" "}
                  {airport.municipality},{" "}
                  {countries.find((c) => c.code === airport.iso_country)
                    ?.name || airport.iso_country}
                </li>
              ))}
            </ul>
          )}
        </div>

        {/* Auto-filled fields */}
        {Object.keys(form).map((key) => {
          if (key === "status") return null;
          return (
            <div className="col-md-4" key={key}>
              <input
                type="text"
                className="form-control"
                name={key}
                placeholder={key}
                value={form[key] || ""}
                readOnly
              />
            </div>
          );
        })}

        {/* Status Dropdown */}
        <div className="col-md-4">
          <select
            className="form-select"
            value={form.status}
            onChange={(e) =>
              setForm((prev) => ({ ...prev, status: e.target.value }))
            }
          >
            <option value="active">Active</option>
            <option value="inactive">Inactive</option>
          </select>
        </div>

        <div className="col-md-12 mt-3 d-flex gap-2">
          <button className="btn btn-success" type="submit">
            {editingAirport ? "Update" : "Add"} Airport
          </button>

          <button
            className="btn btn-secondary"
            type="button"
            onClick={() => setShowForm(false)}
          >
            Cancel
          </button>
        </div>
      </div>
    </form>
  );
};

export default AirportForm;
